import React from 'react';
const Categories = () => {
	const categories = ['Ы','К','Е','Н','Г','Н']
	return (
		<div className="categories">
			<ul>
				<li className="active">Все</li>
				{categories.map((item))}
			</ul>
		</div>
	);
};

export default Categories;
